  bmlfDifferConversionforKG(marrUnit, selectedValue, Qty) {
    let result;
    let selectedResult = marrUnit.filter(x => x.ToKey == selectedValue);
    result = marrUnit.filter(x => x.ToKey == selectedValue);
    if (result.length > 0) if (selectedResult[0].FromKey == this.msWtUOM && selectedResult[0].ToKey == this.msWtUOM) {
      result = Qty * selectedResult[0].convfctr;
    } else if (selectedResult[0].FromKey == this.msWtUOM && selectedResult[0].ToKey == selectedValue) {
      let oldResult = marrUnit.filter(x => x.ToKey == this.msWtUOM);
      result = Qty / selectedResult[0].convfctr * oldResult[0].convfctr;
    }
    return result;
  }
  bmlfDifferConversionforLT(marrUnit, selectedValue, Qty) {
    let result;
    let selectedResult = marrUnit.filter(x => x.ToKey == selectedValue);
    if (selectedResult[0].FromKey == this.msVolUOM && selectedResult[0].ToKey == this.msVolUOM) {
      result = Qty * selectedResult[0].convfctr;
    } else if (selectedResult[0].FromKey == this.msVolUOM && selectedResult[0].ToKey == selectedValue) {
      let oldResult = marrUnit.filter(x => x.ToKey == this.msVolUOM);
      result = Qty / selectedResult[0].convfctr * oldResult[0].convfctr;
    }
    return result;
  }
