  //#region
  bmlfAddLineValidation() {
    let pbRes = true;
    if (this.marrLineItemGrid.length > 0) {
      for (let index = 0; index <= this.marrLineItemGrid.length - 1; index++) {
        let j = index + 1;
        if (this.marrLineItemGrid[index].LineType == "1") {
          if (this.isEmpty(this.marrLineItemGrid[index].LineKey)) {
            this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.VALID.ITEM_KEY') + ' at RowNo ' + j);
            return false;
          } else if (this.isEmpty(this.marrLineItemGrid[index].LocationKey)) {
            this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.VALID.LOCKEY') + ' at RowNo ' + j);
            return false;
          }
        } else if (this.marrLineItemGrid[index].LineType == "2") {
          if (this.isEmpty(this.marrLineItemGrid[index].LineKey)) {
            this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.VALID.LABOUR_KEY') + ' at RowNo ' + j);
            return false;
          }
        } else if (this.marrLineItemGrid[index].LineType == "3") {
          if (this.isEmpty(this.marrLineItemGrid[index].LineKey)) {
            this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.VALID.BOILERPLATE') + ' at RowNo ' + j);
            return false;
          }
        } else {
          return true;
        }
      }
      if (this.marrLineItemGrid.length > 0) {
        this.marrLineItemGrid.forEach((element, index) => {
          let j = index + 1;
          if (element.LineType == '1') {
            if (!this.isEmpty(element.LineKey) && element.hasOwnProperty('uomUnit')) {
              let psLtVol = element.uomUnit.filter(x => x.ToKey == this.msVolUOM)[0];
              let psKGVol = element.uomUnit.filter(x => x.ToKey == this.msWtUOM)[0];
              if (this.isEmpty(psLtVol)) {
                this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.VALID.CONVERSION') + ' ' + element.LineKey + ' at RowNo ' + j + ' in Line Items ');
                pbRes = false;
                return;
              }
              if (this.isEmpty(psKGVol)) {
                this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.VALID.CONVERSION') + ' ' + element.LineKey + ' at RowNo ' + j + ' in Line Items ');
                pbRes = false;
                return;
              }
            }
          }
          if (element.LineType == '2') {
            if (this.isEmpty(element.LineKey)) {
              this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.VALID.LABOUR_KEY') + ' at RowNo ' + j + '');
              pbRes = false;
              return;
            }
          }
          if (element.LineType == '3') {
            if (this.isEmpty(element.LineKey)) {
              this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.VALID.BOILERPLATE') + ' at RowNo ' + j + ' Line Items');
              pbRes = false;
              return;
            }
          }
        });
      }
      if (!pbRes) {
        return false;
      } else {
        return true;
      }
    } else {
      return true;
    }
  }
