  bmlfUnitConversion(piIndex, event) {
    this.mbIsChange = true;
    this.mbcalPropanalysis = true; // 14/Sep/2020 scr no.144662
    if (this.mstabType == src_app_main_costing_constant_product_cost_analysis_const__WEBPACK_IMPORTED_MODULE_2__.TAB_TYPE.LINEITEM) {
      if (!this.isEmpty(event)) {
        let parrSelectedUnit = this.marrLineItemGrid[piIndex].uomUnit.filter(value => value.ToKey == event);
        let parroldUnit = this.marrLineItemGrid[piIndex].uomUnit.filter(value => value.ToKey == this.marrLineItemGrid[piIndex].oldUnit);
        let psQuentity = this.marrLineItemGrid[piIndex].QtyInDisplayUOM;
        let piOldQtyOrder = 0;
        let piOldCostUnit = 0;
        piOldCostUnit = this.marrLineItemGrid[piIndex].CostPerUnit;
        if (parroldUnit.length > 0) {
          if (parroldUnit[0].FromKey == this.marrLineItemGrid[piIndex].oldUnit) {
            piOldQtyOrder = this.marrLineItemGrid[piIndex].QtyInDisplayUOM;
          } else {
            if (parroldUnit[0].Operation == "1") {
              piOldQtyOrder = 1 / parroldUnit[0].convfctr * this.marrLineItemGrid[piIndex].QtyInDisplayUOM;
              piOldCostUnit = parroldUnit[0].convfctr * piOldCostUnit;
            } else if (parroldUnit[0].Operation == "0" || parroldUnit[0].Operation == "2") {
              piOldQtyOrder = parroldUnit[0].convfctr * this.marrLineItemGrid[piIndex].QtyInDisplayUOM;
              piOldCostUnit = 1 / parroldUnit[0].convfctr * piOldCostUnit;
            }
          }
        } else {
          piOldQtyOrder = this.marrLineItemGrid[piIndex].QtyInDisplayUOM;
        }
        if (parrSelectedUnit[0].Operation == "1") {
          psQuentity = parrSelectedUnit[0].convfctr * piOldQtyOrder;
          this.marrLineItemGrid[piIndex].CostPerUnit = 1 / parrSelectedUnit[0].convfctr * piOldCostUnit;
        } else if (parrSelectedUnit[0].Operation == "0" || parrSelectedUnit[0].Operation == "2") {
          psQuentity = 1 / parrSelectedUnit[0].convfctr * piOldQtyOrder;
          this.marrLineItemGrid[piIndex].CostPerUnit = piOldCostUnit * parrSelectedUnit[0].convfctr;
        }
        this.marrLineItemGrid[piIndex].QtyInDisplayUOM = psQuentity;
        this.marrLineItemGrid[piIndex].oldUnit = parrSelectedUnit[0].ToKey;
        this.bmlfgetUOMByLineKey();
        this.BMLFCalcItemSummary();
      } else {
        this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('LINEITEMS.ITEMKEY'));
      }
    } else if (this.mstabType == src_app_main_costing_constant_product_cost_analysis_const__WEBPACK_IMPORTED_MODULE_2__.TAB_TYPE.BYPRODUCT) {
      let parrSelectedUnit = this.marrLineGridByProduct[piIndex].uomUnit.filter(value => value.ToKey == event);
      let parroldUnit = this.marrLineGridByProduct[piIndex].uomUnit.filter(value => value.ToKey == this.marrLineGridByProduct[piIndex].oldUnit);
      let psQuentity = this.marrLineGridByProduct[piIndex].QtyInDisPlayUOM;
      let piOldQtyOrder = 0;
      let piOldCostUnit = 0;
      piOldCostUnit = this.marrLineGridByProduct[piIndex].CostPerUnit;
      if (parroldUnit.length > 0) {
        if (parroldUnit[0].FromKey == this.marrLineGridByProduct[piIndex].oldUnit) {
          piOldQtyOrder = this.marrLineGridByProduct[piIndex].QtyInDisPlayUOM;
        } else {
          if (parroldUnit[0].Operation == "1") {
            piOldQtyOrder = 1 / parroldUnit[0].convfctr * this.marrLineGridByProduct[piIndex].QtyInDisPlayUOM;
            piOldCostUnit = parroldUnit[0].convfctr * piOldCostUnit;
          } else if (parroldUnit[0].Operation == "0" || parroldUnit[0].Operation == "2") {
            piOldQtyOrder = parroldUnit[0].convfctr * this.marrLineGridByProduct[piIndex].QtyInDisPlayUOM;
            piOldCostUnit = 1 / parroldUnit[0].convfctr * piOldCostUnit;
          }
        }
      } else {
        piOldQtyOrder = this.marrLineGridByProduct[piIndex].QtyInDisPlayUOM;
      }
      if (parrSelectedUnit[0].Operation == "1") {
        psQuentity = parrSelectedUnit[0].convfctr * piOldQtyOrder;
        this.marrLineGridByProduct[piIndex].CostPerUnit = 1 / parrSelectedUnit[0].convfctr * piOldCostUnit;
      } else if (parrSelectedUnit[0].Operation == "0" || parrSelectedUnit[0].Operation == "2") {
        psQuentity = 1 / parrSelectedUnit[0].convfctr * piOldQtyOrder;
        this.marrLineGridByProduct[piIndex].CostPerUnit = piOldCostUnit * parrSelectedUnit[0].convfctr;
      }
      this.marrLineGridByProduct[piIndex].QtyInDisPlayUOM = psQuentity;
      this.marrLineGridByProduct[piIndex].oldUnit = parrSelectedUnit[0].ToKey;
      this.bmlfgetUOMByLineKey();
      this.BMLFCalcByProductSummary();
    }
  }
