  BMLFNewCalcItemSummary() {
    if (this.mbIsCalculate == false) {
      return;
    }
    try {
      let pdTotalSysWt = 0;
      let pdTotalSysVol = 0;
      let pdSysWtPerSysVol = 0;
      let pvCostPerSysWt = 0;
      let pvCostPerSysVol = 0;
      let pvTotalRMC = 0;
      let pvTotalCost = 0;
      let pvOverHdCost = 0;
      let pvLaborCost = 0;
      let plloop = 0;
      let pdDensity = 0;
      if (this.marrLineItemGrid.length > 0) {
        if (this.mObjfmast.SpecGravityOverride == 0) {
          for (let index = 0; index < this.marrLineItemGrid.length; index++) {
            if (this.marrLineItemGrid[index]['LineType'] == '1') {
              pdTotalSysWt += Number(this.marrLineItemGrid[index]['SysWt']);
              pdTotalSysVol += Number(this.marrLineItemGrid[index]['SysVol']);
              pvTotalRMC += Number(this.marrLineItemGrid[index]['ExtCost']);
            }
          }
        } else {
          for (let index = 0; index < this.marrLineItemGrid.length; index++) {
            if (this.marrLineItemGrid[index]['LineType'] == '1') {
              pdTotalSysWt += Number(this.marrLineItemGrid[index]['SysWt']);
              pvTotalRMC += Number(this.marrLineItemGrid[index]['ExtCost']);
              pdTotalSysVol = pdTotalSysWt / Number(this.mObjfmast.SpecGravityOverride);
            }
          }
        }
        for (let index = 0; index < this.marrLineItemGrid.length; index++) {
          if (this.marrLineItemGrid[index]['LineType'] == '1') {
            if (Number(pvTotalRMC) > 0) {
              this.marrLineItemGrid[index]['PercentCost'] = Number(this.marrLineItemGrid[index]['ExtCost']) * 100 / Number(pvTotalRMC);
            } else {
              this.marrLineItemGrid[index]['PercentCost'] = 0;
            }
          }
        }
        if (pdTotalSysVol > 0) {
          pdSysWtPerSysVol = pdTotalSysWt / pdTotalSysVol;
        }
        if (pdTotalSysWt > 0) {
          pvCostPerSysWt = pvTotalRMC / pdTotalSysWt;
        }
        if (pdTotalSysVol > 0) {
          pvCostPerSysVol = pvTotalRMC / pdTotalSysVol;
        }
        this.mObjFormulaLineTotal.fmtotalWeight = pdTotalSysWt;
        this.mObjFormulaLineTotal.fmtotalVolume = pdTotalSysVol;
        this.mObjFormulaLineTotal.fmsysWeight = pdSysWtPerSysVol;
        this.mObjFormulaLineTotal.fmcostWeight = pvCostPerSysWt;
        this.mObjFormulaLineTotal.fmcostVolumne = pvCostPerSysVol;
        this.mObjFormulaLineTotal.fmtotalRMCost = pvTotalRMC;
        this.mObjFormulaLineTotal.fmoldtotalWeight = pdTotalSysWt;
        this.mObjFormulaLineTotal.fmoldtotalVolume = pdTotalSysVol;
        this.mObjFormulaLineTotal.fmoldtotalRMCost = pvTotalRMC;
        this.msObjCSItemByProductSummary.TotalWeight = this.mObjFormulaLineTotal.fmtotalWeight;
        this.msObjCSItemByProductSummary.TotalVolume = this.mObjFormulaLineTotal.fmtotalVolume;
        this.msObjCSItemByProductSummary.SysWtPerSysVol = this.mObjFormulaLineTotal.fmsysWeight;
        this.msObjCSItemByProductSummary.CostPerSysWt = this.mObjFormulaLineTotal.fmcostWeight;
        this.msObjCSItemByProductSummary.CostPerSysVol = this.mObjFormulaLineTotal.fmcostVolumne;
        this.msObjCSItemByProductSummary.TotalRMC = this.mObjFormulaLineTotal.fmtotalRMCost;
        if (this.mObjfmast.SpecGravityOverride == 0) {
          pdDensity = pdSysWtPerSysVol;
        } else {
          pdDensity = Number(this.mObjfmast.SpecGravityOverride);
        }
      } else
        // 18/Sep/2020 SCR No.145128 // Clear total's when line item count is zero.
        {
          this.mObjFormulaLineTotal = new src_app_main_costing_models_product_cost_model__WEBPACK_IMPORTED_MODULE_1__.FMtotal();
        }
    } catch (e) {
      console.log(e);
      this.mbIsCalculate = false;
    }
    this.mbIsCalculate = false;
  }
